- input: "TEXT\x1CC00076299\x1C25446851\x1C\x1CF3XA\x1C\"Added to the January 31 report
    the $1,000 contribution to To Organize a Majority Pac on 12/20/07.  Contribution
    was originally sent on 12/20/07; however, bank refused to cash check due to a
    new security measure.  Was not notified until after the first of the year so did
    not put in January 31 year end FEC report.  Notified TOMPAC of the problem, reissued
    check for $1,000 on 2/5/08 stating it was to replace check dated 12/20/07, and
    filed disbursement on FEC March 20 report. Since this contribution was initially
    for 2007, we have now straightened out the situation by filing the contribution
    on the amended January 31 report and removed it from the amended March 20 report.
    \ We are sending amended copies of the following reports as these are the only
    reports that are affected:  January 31, February 20, March 20.\""
